import React, { ReactElement, ReactNode } from 'react';

import { Header } from '@/components/common';
import './styles.scss';

interface IProps {
  children: ReactNode;
  isHeaderOpaque?: boolean;
}

function Layout({ children, isHeaderOpaque }: IProps): ReactElement {
  return (
    <div className='main-layout'>
      <Header isOpaque={isHeaderOpaque} />
      <div className='main-layout_inner'>
        {children}
      </div>
    </div>
  );
}

export default Layout;
